import { EmailOutline, GithubOutline, MoonOutline, SunOutline } from '@styled-icons/evaicons-outline';

export const Icons = {
  Github: GithubOutline,
  Moon: MoonOutline,
  Sun: SunOutline,
  Email: EmailOutline
};
